member.remarks:
The CELLMIN_ON_MATCHES option as a constant string so you can get compile-time spell checking on the name. Whatever the value of MATCH_NAME_PARTIAL, the first found player will always be returned, so if you do a search for _ on an RP server, you could get almost anyone. To detect this case, if more than one player will match the specified string then sscanf will return an ID of cellmin instead. This can be combined with U for a lot more power: sscanf(params, "?<CELLMIN_ON_MATCHES=1>U(-1)", id);
if (id == -1)
{
// No player was entered.
}
else if (id == cellmin)
{
// Multiple matches found
}
else if (id == INVALID_PLAYER_ID)
{
// Entered player is not connected.
}
else
{
// Found just one player.
}
